import Vue from "vue";
import VueRouter from "vue-router";

Vue.use(VueRouter)
const vueRouter = new VueRouter({
    routes:[
        {path:'/0',component:page1},
        {path:"/1",component:page2},
    ]
});
export default vueRouter
